import React from 'react';
import picture from '../images/profile_pic.jpg';
import '../Styles/Summary.scss';
import 'bootstrap/dist/css/bootstrap.css';

export default function Profile() {
  return (
    <div className="summary d-flex justify-content-center vertical-center">
      <div className="profile-picture">
        <img src={picture} alt="picture"></img>
      </div>

      <br></br>

      <div class="jumbotron">
        <h4>About Me</h4>
        <br></br>
        <p>I graduated from the University of Toronto in 2018</p>
        <p>studying political science, Spanish and philosophy.</p>
        <p></p>
      </div>
    </div>
  )
}
